-- ###### EXPORT TRIGGERE ######
-- TRIGGER: TRG_NOTE_AVERAGES
TRIGGER trg_note_averages

FOR INSERT OR UPDATE OR DELETE ON note

COMPOUND TRIGGER



  TYPE id_table IS TABLE OF note.id_student%TYPE INDEX BY PLS_INTEGER;

  affected_ids id_table;

  idx PLS_INTEGER := 0;



  AFTER EACH ROW IS

  BEGIN

    IF INSERTING THEN

      idx := idx + 1;

      affected_ids(idx) := :NEW.id_student;

      DBMS_OUTPUT.PUT_LINE('INSERT → student: ' || :NEW.id_student || ', value: ' || :NEW.valoare);



    ELSIF UPDATING THEN

      idx := idx + 1;

      affected_ids(idx) := :OLD.id_student;

      IF :NEW.id_student != :OLD.id_student THEN

        idx := idx + 1;

        affected_ids(idx) := :NEW.id_student;

      END IF;

      DBMS_OUTPUT.PUT_LINE('UPDATE → student: ' || :OLD.id_student || ' → ' || :NEW.id_student || ', value: ' || :OLD.valoare || ' → ' || :NEW.valoare);



    ELSIF DELETING THEN

      idx := idx + 1;

      affected_ids(idx) := :OLD.id_student;

      DBMS_OUTPUT.PUT_LINE('DELETE → student: ' || :OLD.id_student || ', value: ' || :OLD.valoare);

    END IF;

  END AFTER EACH ROW;



  AFTER STATEMENT IS

  BEGIN

    FOR i IN 1..idx LOOP

      DECLARE

        v_id   NUMBER := affected_ids(i);

        v_avg  NUMBER(5,2);

        v_cnt  INTEGER;

      BEGIN

        -- Check if student has any grades left

        SELECT COUNT(*)

        INTO v_cnt

        FROM note

        WHERE id_student = v_id;



        IF v_cnt = 0 THEN

          DELETE FROM averages WHERE id_student = v_id;

        ELSE

          SELECT ROUND(AVG(valoare), 2)

          INTO v_avg

          FROM note

          WHERE id_student = v_id;



          -- Update or insert

          UPDATE averages SET avg_grade = v_avg WHERE id_student = v_id;

          IF SQL%ROWCOUNT = 0 THEN


          END IF;

        END IF;



      EXCEPTION

        WHEN OTHERS THEN NULL; -- Silent fail on a single ID

      END;

    END LOOP;

  END AFTER STATEMENT;



END trg_note_averages;


-- TRIGGER: TRG_NOTE_DELETE
TRIGGER trg_note_delete

AFTER DELETE ON note

FOR EACH ROW

DECLARE

  v_count INTEGER;

BEGIN

  DBMS_OUTPUT.PUT_LINE('DELETE on NOTE: student=' || :OLD.id_student || ', course=' || :OLD.id_curs || ', value=' || :OLD.valoare);



  BEGIN

    UPDATE averages

    SET avg_grade = (

      SELECT ROUND(AVG(valoare), 2)

      FROM note

      WHERE id_student = :OLD.id_student

    )

    WHERE id_student = :OLD.id_student;



    SELECT COUNT(*) INTO v_count

    FROM note

    WHERE id_student = :OLD.id_student;



    IF v_count = 0 THEN

      DELETE FROM averages WHERE id_student = :OLD.id_student;

    END IF;

  END;

END;


-- TRIGGER: TRG_NOTE_INSERT
TRIGGER trg_note_insert

AFTER INSERT ON note

FOR EACH ROW

BEGIN

  DBMS_OUTPUT.PUT_LINE('INSERT on NOTE: student=' || :NEW.id_student || ', course=' || :NEW.id_curs || ', value=' || :NEW.valoare);



  BEGIN

    UPDATE averages

    SET avg_grade = (

      SELECT ROUND(AVG(valoare), 2)

      FROM note

      WHERE id_student = :NEW.id_student

    )

    WHERE id_student = :NEW.id_student;



    IF SQL%ROWCOUNT = 0 THEN


      VALUES (

        :NEW.id_student,

        (SELECT ROUND(AVG(valoare), 2) FROM note WHERE id_student = :NEW.id_student)

      );

    END IF;

  END;

END;


-- TRIGGER: TRG_NOTE_UPDATE
TRIGGER trg_note_update

AFTER UPDATE ON note

FOR EACH ROW

DECLARE

  v_count INTEGER;

BEGIN

  DBMS_OUTPUT.PUT_LINE('UPDATE on NOTE: student=' || :OLD.id_student || ' → ' || :NEW.id_student || ', value=' || :OLD.valoare || ' → ' || :NEW.valoare);



  -- If student changed, update average for OLD student

  IF :OLD.id_student != :NEW.id_student THEN

    BEGIN

      -- Update old student's average

      UPDATE averages

      SET avg_grade = (

        SELECT ROUND(AVG(valoare), 2)

        FROM note

        WHERE id_student = :OLD.id_student

      )

      WHERE id_student = :OLD.id_student;



      -- Check if old student has any grades left

      SELECT COUNT(*) INTO v_count

      FROM note

      WHERE id_student = :OLD.id_student;



      IF v_count = 0 THEN

        DELETE FROM averages WHERE id_student = :OLD.id_student;

      END IF;

    EXCEPTION

      WHEN OTHERS THEN NULL;

    END;

  END IF;



  -- Always update average for NEW student

  BEGIN

    UPDATE averages

    SET avg_grade = (

      SELECT ROUND(AVG(valoare), 2)

      FROM note

      WHERE id_student = :NEW.id_student

    )

    WHERE id_student = :NEW.id_student;



    IF SQL%ROWCOUNT = 0 THEN


      VALUES (

        :NEW.id_student,

        (SELECT ROUND(AVG(valoare), 2) FROM note WHERE id_student = :NEW.id_student)

      );

    END IF;

  EXCEPTION

    WHEN NO_DATA_FOUND THEN NULL;

  END;

END;



