-- ###### FUNCTION CREEAZA_STUDENT ######
FUNCTION creeaza_student(

  p_nume       VARCHAR2,

  p_prenume    VARCHAR2,

  p_data_n     DATE,

  p_media      NUMBER

) RETURN Student IS

  cnp_gen  VARCHAR2(1);

  cnp_luna VARCHAR2(2);

  cnp_zi   VARCHAR2(2);

  cnp_an   VARCHAR2(2);

  cnp_final VARCHAR2(7);

BEGIN

  IF LOWER(SUBSTR(p_prenume, -1)) = 'a' THEN

    cnp_gen := '2';

  ELSE

    cnp_gen := '1';

  END IF;



  cnp_luna := TO_CHAR(p_data_n, 'MM');

  cnp_zi   := TO_CHAR(p_data_n, 'DD');

  cnp_an   := TO_CHAR(p_data_n, 'YY');



  cnp_final := cnp_gen || cnp_luna || cnp_zi || cnp_an;



  RETURN Student(p_nume, p_prenume, cnp_final, p_media);

END;

-- ###### PACKAGE EXCEPTII ######
PACKAGE exceptii AS

  student_inexistent EXCEPTION;

  student_fara_prieteni EXCEPTION;

  student_fara_note EXCEPTION;



  PRAGMA EXCEPTION_INIT(student_inexistent, -20001);

  PRAGMA EXCEPTION_INIT(student_fara_prieteni, -20002);

  PRAGMA EXCEPTION_INIT(student_fara_note, -20003);

END;


