-- ###### FUNCTION GET_STUDENT_INFO ######
FUNCTION get_student_info(p_id IN studenti.id%TYPE)

RETURN VARCHAR2

AS

  v_nume studenti.nume%TYPE;

  v_prenume studenti.prenume%TYPE;

  v_nr_prieteni NUMBER := 0;

  v_medie NUMBER(5,2);

  b_fara_prieteni BOOLEAN := FALSE;

  b_fara_note BOOLEAN := FALSE;

BEGIN

  -- Verifică dacă studentul există

  SELECT nume, prenume INTO v_nume, v_prenume

  FROM studenti

  WHERE id = p_id;



  -- Verifică prietenii

  SELECT COUNT(*) INTO v_nr_prieteni

  FROM prieteni

  WHERE id_student1 = p_id OR id_student2 = p_id;



  IF v_nr_prieteni = 0 THEN

    b_fara_prieteni := TRUE;

  END IF;



  -- Verifică media

  SELECT ROUND(AVG(valoare), 2)

  INTO v_medie

  FROM note

  WHERE id_student = p_id;



  IF v_medie IS NULL THEN

    b_fara_note := TRUE;

  END IF;



  -- Aruncă excepțiile după ce le-a verificat pe amândouă

  IF b_fara_prieteni THEN

    IF b_fara_note THEN

      RAISE exceptii.student_fara_prieteni; -- ambele vor fi tratate din bloc

    ELSE

      RAISE exceptii.student_fara_prieteni;

    END IF;

  ELSIF b_fara_note THEN

    RAISE exceptii.student_fara_note;

  END IF;



  RETURN v_nume || ' ' || v_prenume || ' | Prieteni: ' || v_nr_prieteni || ' | Medie: ' || v_medie;



EXCEPTION

  WHEN NO_DATA_FOUND THEN

    RAISE exceptii.student_inexistent;

END;


