-- ###### FUNCTION OBTINE_CREDITE ######
FUNCTION obtine_credite(p_id students.id_stud%TYPE)

RETURN NUMBER IS

    credite NUMBER := 0;

BEGIN

    SELECT SUM(g.value * c.credits) 

    INTO credite

    FROM grades g

    JOIN courses c ON g.id_course = c.id_course

    WHERE g.id_stud = p_id;



    return credite;

END;

-- ###### PROCEDURE POPULEAZE_STUDENTI ######
PROCEDURE populeaze_studenti IS

    v_id_stud students.id_stud%TYPE;

    v_fname students.fname%TYPE;

    v_lname students.lname%TYPE;

    v_dob   students.dob%TYPE;



    CURSOR lista_studenti IS

        SELECT id_stud, fname, lname, dob

        FROM students

        WHERE ROWNUM <= 10;



    TYPE studenti_varray IS VARRAY(10) OF Student;

    studenti studenti_varray := studenti_varray();



BEGIN

    OPEN lista_studenti;



    FOR i IN 1..10 LOOP

        FETCH lista_studenti INTO v_id_stud, v_fname, v_lname, v_dob;



        EXIT WHEN lista_studenti%NOTFOUND;



        studenti.EXTEND;

        studenti(i) := creeaza_student(v_fname, v_lname, v_dob, media_studentului(v_id_stud));

    END LOOP;



    CLOSE lista_studenti;

    FOR i IN 1..studenti.COUNT LOOP

        dbms_output.put_line('Student ' || i || ':');

        studenti(i).afiseaza_info;

    END LOOP;

END;

-- ###### TYPE STUDENT ######
TYPE Student AS OBJECT (

    nume        VARCHAR2(50),

    prenume     VARCHAR2(50),

    media       NUMBER(4,2),

    note_zece   INTEGER,

    CONSTRUCTOR FUNCTION student(p_id_stud VARCHAR2) RETURN SELF AS RESULT,

    MEMBER PROCEDURE afiseaza_info,

    MEMBER FUNCTION are_media_mai_mare_ca(s Student) RETURN BOOLEAN

) NOT FINAL;

-- ###### TYPE BODY STUDENT ######
TYPE BODY Student AS

    CONSTRUCTOR FUNCTION student(p_id_stud VARCHAR2) RETURN SELF AS RESULT IS

    BEGIN

        SELECT fname, lname 

        INTO SELF.nume, SELF.prenume

        FROM students

        WHERE id_stud = p_id_stud;



        SELF.media := media_studentului(p_id_stud);

        SELF.note_zece := f_note_zece(p_id_stud);



        RETURN;

    END;



    MEMBER PROCEDURE afiseaza_info IS

    BEGIN

        DBMS_OUTPUT.PUT_LINE('Nume: ' || SELF.nume);

        DBMS_OUTPUT.PUT_LINE('Prenume: ' || SELF.prenume);

        DBMS_OUTPUT.PUT_LINE('Media: ' || TO_CHAR(SELF.media, '90.99'));

        DBMS_OUTPUT.PUT_LINE('Note de 10: ' || SELF.note_zece);

    END;



    MEMBER FUNCTION are_media_mai_mare_ca(s Student) RETURN BOOLEAN IS

    BEGIN

        RETURN SELF.media > s.media;

    END;

END;

-- ###### TYPE STUDENTCUPUNCTE ######
TYPE StudentCuPuncte UNDER Student (

    puncte_total NUMBER,

    CONSTRUCTOR FUNCTION StudentCuPuncte(p_id_stud VARCHAR2) RETURN SELF AS RESULT,

    OVERRIDING MEMBER PROCEDURE afiseaza_info,

    OVERRIDING MEMBER FUNCTION are_media_mai_mare_ca(s Student) RETURN BOOLEAN

);

-- ###### TYPE BODY STUDENTCUPUNCTE ######
TYPE BODY StudentCuPuncte AS

    CONSTRUCTOR FUNCTION StudentCuPuncte(p_id_stud VARCHAR2) RETURN SELF AS RESULT IS

    BEGIN

        SELECT fname, lname

        INTO SELF.nume, SELF.prenume

        FROM students

        WHERE id_stud = p_id_stud;



        SELF.media := media_studentului(p_id_stud);

        SELF.note_zece := f_note_zece(p_id_stud);

        SELF.puncte_total := obtine_credite(p_id_stud);



        RETURN;

    END;



    OVERRIDING MEMBER PROCEDURE afiseaza_info IS

    BEGIN

        DBMS_OUTPUT.PUT_LINE('Nume: ' || SELF.nume);

        DBMS_OUTPUT.PUT_LINE('Prenume: ' || SELF.prenume);

        DBMS_OUTPUT.PUT_LINE('Media: ' || TO_CHAR(SELF.media, '90.99'));

        DBMS_OUTPUT.PUT_LINE('Note de 10: ' || SELF.note_zece);

        DBMS_OUTPUT.PUT_LINE('Puncte totale: ' || SELF.puncte_total);

    END;



    OVERRIDING MEMBER FUNCTION are_media_mai_mare_ca(s Student) RETURN BOOLEAN IS

    BEGIN

        IF TREAT(s AS StudentCuPuncte) IS NOT NULL THEN

            RETURN SELF.puncte_total > TREAT(s AS StudentCuPuncte).puncte_total;

        ELSE

            RETURN FALSE;

        END IF;

    END;

END;

