-- ###### PROCEDURE UPDATE_GRADES_TO_10 ######
PROCEDURE update_grades_to_10(p_ids IN id_list_type) AS

  v_exists INTEGER;

BEGIN

  FOR i IN 1 .. p_ids.COUNT LOOP

    SELECT COUNT(*) INTO v_exists FROM studenti WHERE id = p_ids(i);



    IF v_exists = 0 THEN

      RAISE NO_DATA_FOUND;

    END IF;



    UPDATE note

    SET valoare = 10

    WHERE id_student = p_ids(i);

  END LOOP;

END;


-- ###### PROCEDURE VERIFICA_EXISTENTA ######
PROCEDURE verifica_existenta(p_id studenti.id%TYPE) AS

  v_dummy NUMBER;

BEGIN

  SELECT 1 INTO v_dummy FROM studenti WHERE id = p_id;

EXCEPTION

  WHEN NO_DATA_FOUND THEN

    RAISE exceptii.student_inexistent;

END;


-- ###### PROCEDURE VERIFICA_NOTE ######
PROCEDURE verifica_note(p_id studenti.id%TYPE) AS

  v_avg NUMBER;

BEGIN

  SELECT AVG(valoare) INTO v_avg

  FROM note

  WHERE id_student = p_id;



  IF v_avg IS NULL THEN

    RAISE exceptii.student_fara_note;

  END IF;

END;


-- ###### PROCEDURE VERIFICA_PRIETENI ######
PROCEDURE verifica_prieteni(p_id studenti.id%TYPE) AS

  v_count NUMBER;

BEGIN

  SELECT COUNT(*) INTO v_count

  FROM prieteni

  WHERE id_student1 = p_id OR id_student2 = p_id;



  IF v_count = 0 THEN

    RAISE exceptii.student_fara_prieteni;

  END IF;

END;

